  false,\n\t\"url\": null,\n\t\"notes\": \"An aerial goose survey of the upper Nowitna
  River and a river-floating goose brood survey of the upper Nowitna River were conducted
  May 27th through July 5th of 1986, respectively, to provide baseline trend data
  on goose populations on the Nowitna National Wildlife Refuge. The Nowitna drainage
  provides important breeding and brood-rearing habitat for White-fronted and Canada
  Geese. A description of the study area and a discussion of the results is covered.\",\n\t\"license_title\":
